DECLARE stock_inicial INT;
DECLARE stock_ingreso INT;

SET stock_ingreso = cantidad_articulo;

SELECT stock INTO stock_inicial FROM articulos WHERE id = id_articulo;



RETURN stock_inicial + stock_ingreso;  

end$$

